import React from 'react';

const About = () => {
  return (
    <section id="about" className="section">
      <h2>About Me</h2>
      <p>I am a motivated and versatile software professional with an M.Tech in CSE. I am passionate about building full-stack applications and continually growing with innovative technologies.</p>
    </section>
  );
};

export default About;
